\",\"content\":\" 2021. 11. 18 Platum\\n●\"},{\"type\":\"rt_link\",\"content\":\"\'포스트 코로나 시대의 리모트 워크\' 논의\",\"url\":\"http://www.koit.co.kr/news/articleView.html?idxno=91056\"},{\"type\":\"rt_text\",\"content\":\" 2021. 11. 18 정보통신신문\\n●\"},{\"type\":\"rt_link\",\"content\":\"“10년 후에는 대기업이 스타트업처럼 변할 것” 글로벌 스타트업 이벤트 컴업2021 하이라이트\",\"url\":\"https://platum.kr/archives/175177\"},{\"type\":\"rt_text\",\"content\":\" 2021. 11. 17 Platum \"}]}]}"
        ▿ body_text : Optional<String>
          - some : "어제 모두 참여해주셔서  <@1910070715193FKNLR> 의 세션이 유독 많은 주목을 받았고, 다음 날인  오늘 저희 세션을 여러 매체에서 커버 해주었네요 !!  :uwucry: 올해도 그랬지만, 내년은 정말 국내에서도 더 많은 기대와 주목을 받을 거 같아 설레고 그러네요!! \n많이 공유해주시고 맘껏 자랑해주시어요. \n\n Swit in ComeUp 2021, Swit in Media \n\n● 글로벌 협업 플랫폼 스윗, ‘컴업 2021’서 포스트 코로나시대 협업에 대해 발표... 2021.11.18 서울경제\n: 실리콘밸리에서 시작해 2019년 공식 서비스 출시 이래 184개국 3만 7천 여개의 고객사를 확보하며 글로벌 협업툴으로 성장한 스윗은, 국내외 VC와 기업고객들에게 주목 받으며 이번 컴업 2021에서 ‘포스트 코로나 시대의 리모트 협업’라는 주제로 개막식날 온오프라인의 관객들과 소통했다. 스윗은 업무에서 가장 많이 쓰이는 채팅과 업무관리를 결합하고, 전세계 대다수의 기관과 기업이 사용하는 구글워크스페이스 또는 MS오피스 365 기능들인 이메일·일정관리·화상회의 등과 완벽히 연동되어 한 화면에서 필수적 업무기능을 지원하는 협업 플랫폼이자 운영체제(Work OS)이다. 팬데믹 이후 다양한 기업 환경에 대한 요구가 급증하며 기존 협업툴과는 달리 멀티기능으로서 협업을 지원하는 스윗의 특징이 알려지며 구글, 페이스북, 위워크 등의 글로벌 기업뿐만 아니라 국내에서도 센트랄, 대한항공, 티켓몬스터 등이 속속 도입하고 있다.\n● 코로나19로 흩어진 직원들…\"소통 비용도 기업 생산성 좌우\" 2021. 11. 18 ZDNet Korea\n● 글로벌 협업 플랫폼 \'스윗\', \'컴업 2021\'서 포스트 코로나 시대 협업에 대해 말해 2021. 11. 18 데이터넷 \n● [COMEUP 2021] 포스트 코로나 시대의 ‘리모트 워크’는 어떤 방향으로 갈까 2021. 11. 18 Platum\n● \'포스트 코로나 시대의 리모트 워크\' 논의 2021. 11. 18 정보통신신문\n● “10년 후에는 대기업이 스타트업처럼 변할 것” 글로벌 스타트업 이벤트 컴업2021 하이라이트 2021. 11. 17 Platum"
