    ▿ body_blockskit : Optional<String>
      - some : "{\"type\":\"rich_text\",\"elements\":[{\"type\":\"rt_section\",\"elements\":[{\"type\":\"rt_mention\",\"styles\":{},\"user_id\":\"channel\"},{\"type\":\"rt_text\",\"content\":\" \",\"styles\":{}},{\"type\":\"rt_mention\",\"styles\":{},\"user_id\":\"21040106452891770\"},{\"type\":\"rt_text\",\"content\":\" 전자 결재 기능이 출시되고, 이제 언론보도도 이어지고 있어요~ \",\"styles\":{}},{\"type\":\"rt_emoji\",\"styles\":{},\"name\":\":swit:\"},{\"type\":\"rt_text\",\"content\":\"\\n채팅과 태스크의 분리 될 수 없는 결합, 그리고 이 둘 사이에서 협업의 또다른 축으로 사용되는 전자 결재의 기능은 너무 비싸서 ERP를 도입 못하거나, 아니면 그룹웨어가 너무 엉망이지만 울며 겨자먹기로 전자결재 때문에 쓰고 있는 국내외 중견 \\/ 중소 기업들에게 스윗이 다가갈 수 있는 킬러 피쳐가 될 것이고, 벌써 되고 있어요!\\n\\n벌써 국내 기존 고객들이 스윗 전자 결재를 테스트하고 여러가지 기능 제안을 주셔서 행복한 비명을 지르고 있답니다 \",\"styles\":{}},{\"type\":\"rt_emoji\",\"name\":\":rolling_on_the_floor_laughing:\"},{\"type\":\"rt_text\",\"content\":\"\\n너무 고생 많으셨고, 정말 멋진 최고의 우리 팀입니다 ^^\\n\\n기사를 내주시느라 고생하신 소피 \",\"styles\":{}},{\"type\":\"rt_mention\",\"styles\":{},\"user_id\":\"210830010910A3F8rMN\"},{\"type\":\"rt_text\",\"content\":\" 에게도 감사드려요~ \",\"styles\":{}},{\"type\":\"rt_text\",\"content\":\"\\n\",\"styles\":{}},{\"type\":\"rt_text\",\"content\":\"Special thanks to  \",\"styles\":{}},{\"type\":\"rt_mention\",\"styles\":{},\"user_id\":\"20101200121208gXdNGX\"},{\"type\":\"rt_text\",\"content\":\" 의 친절한 설명\\n&  \",\"styles\":{}},{\"type\":\"rt_mention\",\"styles\":{},\"user_id\":\"19122000393031860\"},{\"type\":\"rt_text\",\"content\":\" 의 멋진 디자인 애셋 \",\"styles\":{}},{\"type\":\"rt_emoji\",\"name\":\":heart_eyes:\"},{\"type\":\"rt_text\",\"content\":\"\\n\",\"styles\":{}},{\"type\":\"rt_text\",\"content\":\"\\np.s.\\n\",\"styles\":{}},{\"type\":\"rt_mention\",\"styles\":{},\"user_id\":\"channel\"},{\"type\":\"rt_text\",\"content\":\" 한가지 부탁드리자면, 네이버에서 \\\"스윗 협업툴\\\"이라고 한 번씩 검색하신 후 \\\"뉴스 탭\\\"에서 어떻게 나오는지 스크린샷 한 번씩 부탁드릴게요~ ^^\\n(향후 네이버 광고 등에도 유용하게 참고자료로 활용 될 것 같아요 ^_^)\",\"styles\":{}}]}]}"
    ▿ body_text : Optional<String>
      - some : "<@channel><@21040106452891770> 전자 결재 기능이 출시되고, 이제 언론보도도 이어지고 있어요~ :swit:\n채팅과 태스크의 분리 될 수 없는 결합, 그리고 이 둘 사이에서 협업의 또다른 축으로 사용되는 전자 결재의 기능은 너무 비싸서 ERP를 도입 못하거나, 아니면 그룹웨어가 너무 엉망이지만 울며 겨자먹기로 전자결재 때문에 쓰고 있는 국내외 중견 / 중소 기업들에게 스윗이 다가갈 수 있는 킬러 피쳐가 될 것이고, 벌써 되고 있어요!\n\n벌써 국내 기존 고객들이 스윗 전자 결재를 테스트하고 여러가지 기능 제안을 주셔서 행복한 비명을 지르고 있답니다 :rolling_on_the_floor_laughing:\n너무 고생 많으셨고, 정말 멋진 최고의 우리 팀입니다 ^^\n\n기사를 내주시느라 고생하신 소피 <@210830010910A3F8rMN> 에게도 감사드려요~ \n Special thanks to <@20101200121208gXdNGX> 의 친절한 설명\n& <@19122000393031860> 의 멋진 디자인 애셋 :heart_eyes:\n \np.s.\n <@channel> 한가지 부탁드리자면, 네이버에서 \"스윗 협업툴\"이라고 한 번씩 검색하신 후 \"뉴스 탭\"에서 어떻게 나오는지 스크린샷 한 번씩 부탁드릴게요~ ^^\n(향후 네이버 광고 등에도 유용하게 참고자료로 활용 될 것 같아요 ^_^)"
