          - some : "{\"type\":\"rich_text\",\"elements\":[{\"type\":\"rt_section\",\"elements\":[{\"type\":\"rt_text\",\"content\":\"Swit in Media\",\"styles\":{\"code\":true,\"bold\":true}},{\"type\":\"rt_text\",\"content\":\"\\n\\n●\"},{\"type\":\"rt_link\",\"content\":\"글로벌 협업툴 스윗, 한국 기업 맞춤형 전자결재 기능 출시\",\"url\":\"http://mirakle.mk.co.kr/view.php?year=2021&no=1096939\"},{\"type\":\"rt_text\",\"content\":\" 2021. 11. 25 매일경제 \\n: 글로벌 엔터프라이즈 협업 소프트웨어 기업 스윗이 기업들에게 가장 필요한 소프트웨어 중 하나인 ‘전자결재’를 기능을 출시했다. \"},{\"type\":\"rt_text\",\"content\":\"채팅과 업무관리가 결합한 협업툴 스윗은 구글워크스페이스과 MS오피스의 이메일, 일정 및 문서 관리 등의 기본 앱들과 완벽히 연동되는 필수 협업 기능의 플랫폼으로서, 이번 \",\"styles\":{\"bold\":true}},{\"type\":\"rt_text\",\"content\":\"전자결재 플러그인을 통해 ‘협업 운영체제(Work OS)’로서의 기능을 한층 강화\",\"styles\":{\"code\":true}},{\"type\":\"rt_text\",\"content\":\"시켰다.\",\"styles\":{\"bold\":true}},{\"type\":\"rt_text\",\"content\":\" 센트랄(CTR) 강상우 총괄사장은  “간단하고 가벼운 전자결재 플러그인 설치로 채팅과 업무관리와 완벽히 연동해 직원 간 소통을 투명하고 수월하게 할 수 있게 됐다”고 기대감을 밝혔다. \\n\\n●\"},{\"type\":\"rt_link\",\"content\":\"K-협업툴 \'스윗\', 더 스윗해진다…전자결재 기능 출시\",\"url\":\"http://news.mt.co.kr/mtview.php?no=2021112518024086901\"},{\"type\":\"rt_text\",\"content\":\" 2021. 11. 25 머니투데이 \\n●\"},{\"type\":\"rt_link\",\"content\":\"협업툴 스윗, \'전자결재\' 기능 탑재\",\"url\":\"https://zdnet.co.kr/view/?no=20211125145416\"},{\"type\":\"rt_text\",\"content\":\" 2021. 11. 25 지디넷 코리아\\n●\"},{\"type\":\"rt_link\",\"content\":\"글로벌 협업 플랫폼 스윗, 전자결재 기능 선봬\",\"url\":\"http://www.it-b.co.kr/news/articleView.html?idxno=54850\"},{\"type\":\"rt_text\",\"content\":\" 2021. 11. 25 아이티비즈\\n●\"},{\"type\":\"rt_link\",\"content\":\"글로벌 협업 플랫폼 스윗, 전자결재 기능 출시\",\"url\":\"http://www.newsworks.co.kr/news/articleView.html?idxno=583128\"},{\"type\":\"rt_text\",\"content\":\" 2021. 11. 25 뉴스웍스 \\n●\"},{\"type\":\"rt_link\",\"content\":\"글로벌 협업 플랫폼 \'스윗\', 전자결재 기능 출시\",\"url\":\"http://www.datanet.co.kr/news/articleView.html?idxno=166925\"},{\"type\":\"rt_text\",\"content\":\" 2021. 11. 25 데이터넷 \\n●\"},{\"typ