      - some : "{\"type\":\"rich_text\",\"elements\":[{\"type\":\"rt_section\",\"elements\":[{\"type\":\"rt_text\",\"content\":\"한국 출장가서 발견한 우리나라 기업들이 갖고 있는 커다란 오해중 하나가 \\\"\",\"styles\":{}},{\"type\":\"rt_text\",\"content\":\"전자결재는 한국에서만 쓰이는 한국적인(부정적 의미의) 기능\",\"styles\":{\"bold\":true}},{\"type\":\"rt_text\",\"content\":\"\\\"으로 여기고 있다는 점이었어요. 바로잡자면, 우리나라에서 만든 그룹웨어들이 너무 낙후해서 그렇지, Approvals는 미국 및 글로벌 기업들이 모두 사용하는 중요한 소프트웨어의 한 카테고리에요!\\n\\n보통은 ERP 안에서 해당기능을 사용하고 있기에, ERP를 쓰기에는 너무 무거운 중소.중견 기업들을 위해 스윗이 전자결재 플러그인을 스윗스토어에 출시했어요\",\"styles\":{}},{\"type\":\"rt_emoji\",\"name\":\":tada:\"},{\"type\":\"rt_text\",\"content\":\" 스윗의 \",\"styles\":{}},{\"type\":\"rt_text\",\"content\":\"챗, 업무관리 기능과 연동되어 협업 컨텍스트를 승인과 거절에 활용하기 매우 편리해\",\"styles\":{\"bold\":true}},{\"type\":\"rt_text\",\"content\":\"졌어요! 저도 출시 첫날부터 다양한 마케팅 캠페인, SaaS 구매건 등과 관련해서 미국팀들과 열심히 쓰고 있어요\",\"styles\":{}},{\"type\":\"rt_emoji\",\"name\":\":blush:\"},{\"type\":\"rt_text\",\"content\":\"\\n\\n이제 스윗은 \",\"styles\":{}},{\"type\":\"rt_text\",\"content\":\"협업의 에센셜인 \\\"업무관리와 챗\\\"을 베이스\",\"styles\":{\"bold\":true}},{\"type\":\"rt_text\",\"content\":\"로 \\\"구글 워크스페이스와 MS오피스\\\"와의 완벽한 연동, 그리고 Approvals 및 OKR, Agile, Project Mgmt 등 스윗의 다양한 \",\"styles\":{}},{\"type\":\"rt_text\",\"content\":\"커스텀 플러그인들로 \'협업 운영체제(Work OS)\'로서의 포지셔닝을 더욱 강화\",\"styles\":{\"bold\":true}},{\"type\":\"rt_text\",\"content\":\"시켜 나갈거에요\",\"styles\":{}},{\"type\":\"rt_emoji\",\"name\":\":heartpulse:\"},{\"type\":\"rt_text\",\"content\":\" 툴에 맞추지 마세요! 스윗이 모든 워크플로우에 맞게 커스텀 환경을 제공할테니까요.\\n\\nSwit\'s Work OS formula\\n= Collaboration Essentials(Tasks + Chat)\\n+ Customizable Plug_Ins(Approvals + OKR + …)\\n+ the Frontend hub(Google Workspace + MS365)\\n\\n멋진 기사 써주신 매경의 이덕주기자님, PR & Comms 리드 소피, 멋진 인터뷰 남겨주신 강상우 총괄사장님 감사드려요\",\"styles\":{}},{\"type\":\"rt_emoji\",\"name\":\":grinning:\"},{\"type\":\"rt_emoji\",\"name\":\":pray:\"},{\"type\":\"rt_emoji\",\"name\":\":heart:\"},{\"type\":\"rt_text\",\"content\":\"️\",\"styles\":{}},{\"type\":\"rt_text\",\"content\":\" \",\"styles\":{}},{\"styles\":{},\"content\":\"https:\\/\\/mirakle.mk.co.kr\\/view.php?year=2021&no=1096939\",\"type\":\"rt_link\",\"url\":\"https:\\/\\/mirakle.mk.co.kr\\/view.php?year=2021&no=1096939\"}]}]}"
    ▿ body_text : Optional<String>
      - some : "한국 출장가서 발견한 우리나라 기업들이 갖고 있는 커다란 오해중 하나가 \" 전자결재는 한국에서만 쓰이는 한국적인(부정적 의미의) 기능 \"으로 여기고 있다는 점이었어요. 바로잡자면, 우리나라에서 만든 그룹웨어들이 너무 낙후해서 그렇지, Approvals는 미국 및 글로벌 기업들이 모두 사용하는 중요한 소프트웨어의 한 카테고리에요!\n\n보통은 ERP 안에서 해당기능을 사용하고 있기에, ERP를 쓰기에는 너무 무거운 중소.중견 기업들을 위해 스윗이 전자결재 플러그인을 스윗스토어에 출시했어요 :tada: 스윗의 챗, 업무관리 기능과 연동되어 협업 컨텍스트를 승인과 거절에 활용하기 매우 편리해 졌어요! 저도 출시 첫날부터 다양한 마케팅 캠페인, SaaS 구매건 등과 관련해서 미국팀들과 열심히 쓰고 있어요 :blush:\n\n이제 스윗은 협업의 에센셜인 \"업무관리와 챗\"을 베이스 로 \"구글 워크스페이스와 MS오피스\"와의 완벽한 연동, 그리고 Approvals 및 OKR, Agile, Project Mgmt 등 스윗의 다양한 커스텀 플러그인들로 \'협업 운영체제(Work OS)\'로서의 포지셔닝을 더욱 강화 시켜 나갈거에요 :heartpulse: 툴에 맞추지 마세요! 스윗이 모든 워크플로우에 맞게 커스텀 환경을 제공할테니까요.\n\nSwit\'s Work OS formula\n= Collaboration Essentials(Tasks + Chat)\n+ Customizable Plug_Ins(Approvals + OKR + …)\n+ the Frontend hub(Google Workspace + MS365)\n\n멋진 기사 써주신 매경의 이덕주기자님, PR & Comms 리드 소피, 멋진 인터뷰 남겨주신 강상우 총괄사장님 감사드려요 :grinning::pray::heart:️ https://mirakle.mk.co.kr/view.php?year=2021&no=1096939"
