      - some : "{\"type\":\"rich_text\",\"elements\":[{\"type\":\"rt_section\",\"elements\":[{\"type\":\"rt_text\",\"content\":\"개발팀 중심으로 툴링을 하면서 다른 펑션 팀 관리에 어려움을 겪는 조직들을 종종 봐요. 프로덕트 포함 개발팀은 오히려 스크럼 주기가 상대적으로 길고 스프린트 사이클도 규칙적이라 프로젝트 산출물이 예상가능하게 관리되는데 비해, HR, PR, BX, UR, Media, DT, Growth, Sales는 \"},{\"type\":\"rt_text\",\"content\":\"대체로 스프린트 없이 돌아가고, 태스크 단위도 짧고, 종류도 다양해서 적절한 태스크 관리 툴 없이는 예측과 협업이 더 어려워요\",\"styles\":{\"bold\":true,\"italic\":true}},{\"type\":\"rt_text\",\"content\":\". 개발팀과 비개발팀간 소통을 하는 프로세스를 만드는 것도 중요하지만, 비개발팀들이 팀내, 팀간 협업을 수행, 관리할 수 있는 환경을 만드는 것은 매출성장을 주요 메트릭으로 관리하는 조직일수록 더 크리티컬 할 수 밖에 없죠. 리모트/하이브리드 환경에서 이 니즈는 더욱 시급하겠지요.\\n\\n이 문제를 해결하고자 \"},{\"type\":\"rt_text\",\"content\":\"산업과 부서 중립적인\",\"styles\":{\"bold\":true,\"italic\":true}},{\"type\":\"rt_text\",\"content\":\" 협업의 에센셜을 공통분모로 멀티펑션 프로덕트를 만든것이 스윗이에요. \"},{\"type\":\"rt_text\",\"content\":\"버티컬 대신에, 호리잔틀 플레이로 고투마켓\",\"styles\":{\"bold\":true,\"italic\":true}},{\"type\":\"rt_text\",\"content\":\"을 하는 특이한 시장전략이죠! 모든 기업들이 사용하는 구글, MS앱들에 프론트엔드 환경을 제공하는 스윗만의 아이코닉한 우측패널과 부서/팀 별 웍플로우에 따른 프로덕트 커스텀을 지원하는 플러그인과 인테그레이션을 위한 마켓플레이스 스윗스토어로 플랫폼 환경을 꾸준히 업그레이드 하고 있어요. 이 어려운 공식(?)을 누구나 쉽게 알아볼 수 있게끔 표현해 달라고 했는데 \"},{\"type\":\"rt_mention\",\"user_id\":\"2106280009120UH2whfP\"},{\"type\":\"rt_text\",\"content\":\"이 멋지게 해석해서 작품을 내놨어요! 너무 공유하고 싶어서 일주일 앞서서 새치기로 먼저 이곳에 공유합니다ㅋㅋ \"},{\"type\":\"rt_mention\",\"user_id\":\"19111305550627280\"},{\"type\":\"rt_text\",\"content\":\" 으흐흐흐\"}]}]}"
    ▿ body_text : Optional<String>
      - some : "개발팀 중심으로 툴링을 하면서 다른 펑션 팀 관리에 어려움을 겪는 조직들을 종종 봐요. 프로덕트 포함 개발팀은 오히려 스크럼 주기가 상대적으로 길고 스프린트 사이클도 규칙적이라 프로젝트 산출물이 예상가능하게 관리되는데 비해, HR, PR, BX, UR, Media, DT, Growth, Sales는 대체로 스프린트 없이 돌아가고, 태스크 단위도 짧고, 종류도 다양해서 적절한 태스크 관리 툴 없이는 예측과 협업이 더 어려워요 . 개발팀과 비개발팀간 소통을 하는 프로세스를 만드는 것도 중요하지만, 비개발팀들이 팀내, 팀간 협업을 수행, 관리할 수 있는 환경을 만드는 것은 매출성장을 주요 메트릭으로 관리하는 조직일수록 더 크리티컬 할 수 밖에 없죠. 리모트/하이브리드 환경에서 이 니즈는 더욱 시급하겠지요.\n\n이 문제를 해결하고자 산업과 부서 중립적인  협업의 에센셜을 공통분모로 멀티펑션 프로덕트를 만든것이 스윗이에요. 버티컬 대신에, 호리잔틀 플레이로 고투마켓 을 하는 특이한 시장전략이죠! 모든 기업들이 사용하는 구글, MS앱들에 프론트엔드 환경을 제공하는 스윗만의 아이코닉한 우측패널과 부서/팀 별 웍플로우에 따른 프로덕트 커스텀을 지원하는 플러그인과 인테그레이션을 위한 마켓플레이스 스윗스토어로 플랫폼 환경을 꾸준히 업그레이드 하고 있어요. 이 어려운 공식(?)을 누구나 쉽게 알아볼 수 있게끔 표현해 달라고 했는데 <@2106280009120UH2whfP>이 멋지게 해석해서 작품을 내놨어요! 너무 공유하고 싶어서 일주일 앞서서 새치기로 먼저 이곳에 공유합니다ㅋㅋ <@19111305550627280> 으흐흐흐"
