      - some : "{\"type\":\"rich_text\",\"elements\":[{\"type\":\"rt_section\",\"elements\":[{\"type\":\"rt_text\",\"content\":\"스윗이 \"},{\"type\":\"rt_text\",\"content\":\"260억원 규모\",\"styles\":{\"bold\":true}},{\"type\":\"rt_text\",\"content\":\"의 시리즈A를 클로징했어요\"},{\"type\":\"rt_emoji\",\"name\":\":rocket:\"},{\"type\":\"rt_emoji\",\"name\":\":rocket:\"},{\"type\":\"rt_emoji\",\"name\":\":rocket:\"},{\"type\":\"rt_text\",\"content\":\"\\n\\n미국본사와 한국지사에 나뉘어져있던 복잡한 소유 구조를 우여곡절 끝에 2년여만에 깔끔하게 정리하고 \"},{\"type\":\"rt_text\",\"content\":\"플립하면서 우리나라에서 마지막으로 유치하는 펀딩\",\"styles\":{\"bold\":true}},{\"type\":\"rt_text\",\"content\":\"이라 더욱 의미있고 감사했던 라운드였어요\"},{\"type\":\"rt_emoji\",\"name\":\":smiling_face_with_3_hearts:\"},{\"type\":\"rt_text\",\"content\":\"\\n\\n이번 라운드는 두번의 멀티클로징으로 처음은 CPS로, 두번째는 캡없는 SAFE로 유치하여 현재 \"},{\"type\":\"rt_text\",\"content\":\"기업가치는 $300M를 상회할 것으로 예상\",\"styles\":{\"bold\":true}},{\"type\":\"rt_text\",\"content\":\"하고, 다음라운드까지 공격적으로 성장할 수 있는 기회를 얻었어요\"},{\"type\":\"rt_emoji\",\"name\":\":tada:\"},{\"type\":\"rt_text\",\"content\":\"\\n\\n이번 펀딩을 통해, 미국본토에서는 경쟁사들의 \"},{\"type\":\"rt_text\",\"content\":\"초기 네트워크 효과를 무효화\",\"styles\":{\"bold\":true}},{\"type\":\"rt_text\",\"content\":\"시킬 수 있는 여러 전략들을 \"},{\"type\":\"rt_text\",\"content\":\"프로덕트와 플랫폼\",\"styles\":{\"bold\":true}},{\"type\":\"rt_text\",\"content\":\"을 통해 단계적으로 수행하고, 중동, 동남아 지역등 \"},{\"type\":\"rt_text\",\"content\":\"경쟁사들의 마켓쉐어가 약한 국가들에는 로컬커런시 제공\",\"styles\":{\"bold\":true}},{\"type\":\"rt_text\",\"content\":\"을 통한 수평 시장확대에 주력할 계획이에요. 물론 스윗 프로덕트는 모든 면에서 매분기마다 더 좋아질거구요~\\n\\n이번 라운드는 제가 한 게 거의 없다고 해도 무방할만큼 100% 리퍼럴과 인바운드로 펀딩이 클로징되었어요. 필요 최소예산인 $10M을 목표로 시작했는데 $40M이 금방 오버부킹되었고, \"},{\"type\":\"rt_text\",\"content\":\"나스닥 상장을 목표로 하는 2026~2027년 이후 만료되는 펀드와 후속참여 최소 $10M이 가능한 조건\",\"styles\":{\"bold\":true}},{\"type\":\"rt_text\",\"content\":\" 등을 여쭈어가면서 타겟을 좁혔음에도, 결국 당초 목표보다 모집금액을 크게 늘릴 수 밖에 없었어요. 참여하신 모든 주주분들이 너무너무 좋아서 한분도 놓칠 수가 없었거든요\"},{\"type\":\"rt_emoji\",\"name\":\":su:\"},{\"type\":\"rt_emoji\",\"name\":\":wit:\"},{\"type\":\"rt_text\",\"content\":\"\\n\\n스윗의 한분한분을 대표하여 \"},{\"type\":\"rt_mention\",\"user_id\":\"1910070715193VOIYX\"},{\"type\":\"rt_text\",\"content\":\" 분들께 진심으로 감사드려요\"},{\"type\":\"rt_emoji\",\"name\":\":swit:\"},{\"type\":\"rt_text\",\"content\":\" 여러분 모두 저의 영웅들입니다\"},{\"type\":\"rt_emoji\",\"name\":\":swit:\"},{\"type\":\"rt_text\",\"content\":\" 이번에도 멋진 기사 내보내주신 \"},{\"type\":\"rt_mention\",\"user_id\":\"210830010910A3F8rMN\"},{\"type\":\"rt_text\",\"content\":\" 감사해요~ 우리 팀원들의 노고를 많이많이 알려주세요^^\"}]}]}"
    ▿ body_text : Optional<String>
      - some : "스윗이 260억원 규모 의 시리즈A를 클로징했어요 :rocket::rocket::rocket:\n\n미국본사와 한국지사에 나뉘어져있던 복잡한 소유 구조를 우여곡절 끝에 2년여만에 깔끔하게 정리하고 플립하면서 우리나라에서 마지막으로 유치하는 펀딩 이라 더욱 의미있고 감사했던 라운드였어요 :smiling_face_with_3_hearts:\n\n이번 라운드는 두번의 멀티클로징으로 처음은 CPS로, 두번째는 캡없는 SAFE로 유치하여 현재 기업가치는 $300M를 상회할 것으로 예상 하고, 다음라운드까지 공격적으로 성장할 수 있는 기회를 얻었어요 :tada:\n\n이번 펀딩을 통해, 미국본토에서는 경쟁사들의 초기 네트워크 효과를 무효화 시킬 수 있는 여러 전략들을 프로덕트와 플랫폼 을 통해 단계적으로 수행하고, 중동, 동남아 지역등 경쟁사들의 마켓쉐어가 약한 국가들에는 로컬커런시 제공 을 통한 수평 시장확대에 주력할 계획이에요. 물론 스윗 프로덕트는 모든 면에서 매분기마다 더 좋아질거구요~\n\n이번 라운드는 제가 한 게 거의 없다고 해도 무방할만큼 100% 리퍼럴과 인바운드로 펀딩이 클로징되었어요. 필요 최소예산인 $10M을 목표로 시작했는데 $40M이 금방 오버부킹되었고, 나스닥 상장을 목표로 하는 2026~2027년 이후 만료되는 펀드와 후속참여 최소 $10M이 가능한 조건  등을 여쭈어가면서 타겟을 좁혔음에도, 결국 당초 목표보다 모집금액을 크게 늘릴 수 밖에 없었어요. 참여하신 모든 주주분들이 너무너무 좋아서 한분도 놓칠 수가 없었거든요 :su::wit:\n\n스윗의 한분한분을 대표하여 <@1910070715193VOIYX> 분들께 진심으로 감사드려요 :swit: 여러분 모두 저의 영웅들입니다 :swit: 이번에도 멋진 기사 내보내주신 <@210830010910A3F8rMN> 감사해요~ 우리 팀원들의 노고를 많이많이 알려주세요^^"
