        ▿ body_text : Optional<String>
          - some : "Swit in Media \n\n● 글로벌 협업 플랫폼 스윗, 260억원 시리즈A 투자유치 2021.12.16 매일경제 \n: 시드투자에 참여했던 SV인베스트먼트와 전략투자사인 센트랄(CTR)이 공동 리드한 이번 시리즈A 투자는 미래에셋벤처투자가 후속 투자하고 IMM인베스트먼트, 스마일게이트인베스트먼트, 두나무파트너스, 하나금융투자, 클라우스파트너스, 프라이머 사제가 신규 투자자로서 참여했다. 이에 스윗은 약 400억원의 누적 투자금을 안정적으로 확보했다.\n빠르게 변화하는 글로벌 엔터프라이즈 시장을 타깃으로 한 스윗은 이러한 차별화를 바탕으로 2019년 정식 버전을 출시한 이래 184개국 3만7000여개의 팀과 기업이 사용하는 초고속 성장을 이뤘다. 올해 상반기부터 유료화를 통해 2분기만에 13배의 MRR(월반복매출) 증가와 유료고객 가입자 이탈율(churn rate)을 1% 미만으로 유지하며 기존 투자사들의 신뢰와 고객 충성도를 입증했다.\nSV인베스트먼트 강민구 이사는 “포스트 코로나 시대를 맞아 엔터프라이즈의 디지털전환이 가속화 되는 환경에서 스윗은 업사이드가 가장 큰 협업 소프트웨어를 만든 첫 K-유니콘이 될 것”이라고 전망했다.\n스윗 공동창업자 겸 CEO 이주환 대표는 “2022년은 더욱 차별화되고 강력해진 제품으로 13개 국어로 제공되고 더 많은 글로벌 고객들이 이용할 수 있게 될 것”이라고 말했다. 공동창업자 임상석 기술총괄책임자(CTO)는 “옥션의 CTO로써 옥션이 이베이에 약 1억 2천만 달러에 매각 되는것을 경험했는데, 시리즈 A에서 스윗의 기업가치는 이미 약 1억 5천만불이 됐다”면서 “처음부터 실리콘밸리에서 시작해 다양한 글로벌 고객의 생생한 피드백을 반영하고, 기존 협업툴과는 다른 방향을 제시하는 점들이 투자사들에게 잘 공감이 된 것 같다”고 설명했다.\n\n● 글로벌 협업 플랫폼 스윗, 260억원 시리즈A 투자유치2021. 12. 16 플래텀\n● 글로벌 협업 소프트웨어 스윗, 260억 투자 유치 2021. 12.16 조선비즈\n● 협업 플랫폼 스윗, 260억 유치...기업가치 3000억 2021. 12. 16 테크월드\n● 협업 플랫폼 스윗, 260억 시리즈A 투자 유치 2021. 12. 16 서울경제\n● 글로벌 협업 플랫폼 \'스윗\', 260억원 초기 투자유치 2021.12.16 머니투데이\n● 글로벌 협업 플랫폼 스윗, 260억원 시리즈A 투자 유치 2021. 12. 16 뉴스1\n● 협업 플랫폼 스윗, 260억원 시리즈A 투자유치..최고 평가 2021. 12. 16 이데일리\n● 협업툴 시장 판 바꾸나…스윗, 260억원 시리즈A 투자유치 2021. 12. 16 블로터 \n● 협업 플랫폼 스윗, 260억원 시리즈A 투자 유치 2021. 12. 16 ZDnet Korea\n● 구글이 점 찍은 스타트업 스윗, 국내외에서 대규모 투자유치 2021. 12. 16 한국일보 \n● 기업용 협업 플랫폼 스타트업 스윗, 260억원 규모 투자 유치 2021. 12. 16 디지털투데이 \n● [fn마켓워치]SV·센트랄·미래·IMM·스마일·두나무·하나금투·클라우 2021. 12. 16 파이낸셜투데이\n● 글로벌 협업 플랫폼 \'스윗\', 260억 시리즈A 투자 유치 2021. 12. 16 데이터넷\n● 스윗, 260억원 규모 시리즈 A 투자 유치 2021. 12. 16 디지털데일리 \n● 시리즈A에 260억...글로벌 협업 플랫폼 스윗 투자 유치 2021. 12. 16 아주경제\n● 글로벌 협업 플랫폼 스윗, 260억원 시리즈A 투자유치… 누적 투자 2021. 12. 17 세계비즈\n● 글로벌 협업 플랫폼 \'스윗\', 260억원 시리즈A 투자유치 2021.12.17 정보통신신문\n\n*매일경제, 서울경제, 지디넷, 이데일리, 플래텀 등에서 저희 C-level 분들의 이미지와 함께 기사 전문이 실렸습니다."
