    ▿ body_blockskit : Optional<String>
      - some : "{\"type\":\"rich_text\",\"elements\":[{\"type\":\"rt_section\",\"elements\":[{\"type\":\"rt_text\",\"content\":\"알토스라는 VC에서 토스, 쿠팡, 배민 등 여러 유니콘을 만들며 수백배의 멀티플 이익을 만들었지만 다 합쳐도, 나스닥에 상장한 로블럭스 이익금 하나 따라가지 못했다고해요. 로블럭스 멀티플은 고작 25배 였던것같아요.\\n\\n한킴 대표님께서 한국 비즈니스 사이즈가 결코 작지 않다고 오랫동안 주장해오시면서 (엑싯 사례들을 보면) \",\"styles\":{}},{\"type\":\"rt_text\",\"content\":\"검증된 실리콘밸리 플레이어들의 내수 버전 모바일앱에만 주로 투자\",\"styles\":{\"bold\":true,\"italic\":true}},{\"type\":\"rt_text\",\"content\":\"를 해오셨는데 로블럭스 엑싯을 하시면서 아마 생각이 바뀌지 않으셨을까 싶어요\",\"styles\":{}},{\"type\":\"rt_emoji\",\"name\":\":thinking_face:\"},{\"type\":\"rt_text\",\"content\":\"\\n\\n이런 점에서 한경의 기사가 의미있다고보며, 거대한 꿈을 갖고 무모한 도전을 하는 Enterprise SaaS 스윗에 신뢰로 초기 투자해주셨던 우리 주주분들과 임직원들이 더더더 정말 멋지고 힘든 결정을 하셨다고 생각해요! 투자든 사업이든 결국 결과로만 이야기를 해야하니 우리가 잘해야겠지만요^^ 여러분 짱 멋져요!!! \",\"styles\":{}},{\"styles\":{},\"content\":\"https:\\/\\/www.hankyung.com\\/economy\\/article\\/2021121986721?fbclid=IwAR1G7NjyvXGS0sICFy-hpkpN2gxjElDXpP3RagdcN2SECyXnSQraEyzl8MA\",\"type\":\"rt_link\",\"url\":\"https:\\/\\/www.hankyung.com\\/economy\\/article\\/2021121986721?fbclid=IwAR1G7NjyvXGS0sICFy-hpkpN2gxjElDXpP3RagdcN2SECyXnSQraEyzl8MA\"}]}]}"
